import React, { useState, useEffect } from 'react';
import data from "../common/data.json";
 const home = () => {

  
  return (
    <>
    <div><h1>Home</h1></div>
    <select>
        {data.map(user => (
          <option value={user.id}>{user.name}</option>
        ))}
      </select>
      
      </>
  )
}
export default home;
